import React from 'react';


class Rate extends React.Component{
  render(){
    return(
      <div>
        <Rating
           value={3}
           max={5}
           onChange={(i) => console.log('onChange ' + i)}
           readOnly
         />
      </div>
    )
  }
}
export default Rate
